;; gorilla-repl.fileformat = 1

;; **
;;; # Mastering masking
;;; 
;; **

;; @@
(ns tasteless-lagoon
  (:require
    [opencv4.core :refer :all]
    [opencv4.utils :as u]
[opencv4.gorilla :as g]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; ## read the original picture
;; **

;; @@
(def rose
  (-> "resources/chapter02/red_rose.jpg"
      (imread IMREAD_REDUCED_COLOR_2)))
(g/>> rose)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"246\" height=\"184\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6a8d4eac \"BufferedImage@6a8d4eac: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@43b61642 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 246 height = 184 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## convert the color space to HSV
;; **

;; @@
(def hsv
  (-> rose clone (cvt-color! COLOR_RGB2HSV)))

(g/>> hsv)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"246\" height=\"184\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x65222318 \"BufferedImage@65222318: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@43b61642 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 246 height = 184 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## filter on red and create a mask from that filtering
;; **

;; @@
(def lower-red  (new-scalar 120 30 15))
(def upper-red (new-scalar 130 255 255))
(def mask (new-mat))
(in-range hsv lower-red upper-red mask)

(g/>> mask)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"246\" height=\"184\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x484200b8 \"BufferedImage@484200b8: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@6a7be236 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 246 height = 184 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; **
;;; 
;; **

;; @@
(def res (new-mat))
(bitwise-and! rose res mask)
(g/>> res)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"246\" height=\"184\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1e4421e1 \"BufferedImage@1e4421e1: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@43b61642 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 246 height = 184 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## adjust luminosity of the pixels selected by the mask
;; **

;; @@
; change the color by using convert-to and
; apply  original*alpha  + beta on each pixel
(def res2 (new-mat))
(convert-to res res2 -1 1 100)

(g/>> res2)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"246\" height=\"184\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x72ea8f11 \"BufferedImage@72ea8f11: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@43b61642 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 246 height = 184 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
; copy the updated picture (which is the masked portion)
; to the original (a clone of)
(def cl (clone rose))
(copy-to res2 cl mask)

(g/>> cl)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"246\" height=\"184\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1cad380a \"BufferedImage@1cad380a: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@43b61642 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 246 height = 184 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## copy something completely different using the mask
;; **

;; @@
(def cl2 
  (imread "resources/chapter02/emilie1.jpg"))
(def cl3 
  (clone rose))

(resize! cl2 (new-size (cols mask) (rows mask)))
(g/>> cl2)

(copy-to cl2 cl3 mask)

(g/>> cl3)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"246\" height=\"184\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x3d24e432 \"BufferedImage@3d24e432: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@43b61642 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 246 height = 184 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

